        <h1 className="title" style={{color:"black"}}>Dashboard</h1>
        <h2 className="subtitle" style={{color:"black"}}> Bienvenido de nuevo... <strong className=''> {user &&  user.mail} </strong></h2>
    </div>
  )
}

export default Welcome;
